import React from "react";

function Humidity(props) {
  return (
    <div>
      {props.humidity && 
        <p>
          Humidity : <span>{props.humidity}</span>
        </p>
      }
      {props.description && <p>
          desc : <span>{props.desc}</span>
        </p>}
        {props.error && <p>
          desc : <span>{props.error}</span>
        </p>}
    </div>
  );
}

export default Humidity;
